import React from "react";
import '../style/header.css'

export class Header extends React.Component {
    constructor (props) {
        super(props)
        this.state = {
            list: {}
        }
    }

    render() {
        return (
            <div className="headerLine">
                <img alt="Home" src="logo192.png"></img>
                <h1>1223</h1>
                <h1>1223</h1>
            </div>
        )
    }
}
